import React, { useState, useEffect } from 'react';
import BorrowService from './BorrowService';
import ClientService from '../ClientF/ClientService';
import MediaService from '../Media/MediaService';

const BorrowLister = () => {
    const [borrowList, setBorrowList] = useState([]);
    const [clientList, setClientList] = useState([]);
    const [mediaList, setMediaList] = useState([]);
    const [filterClient, setFilterClient] = useState('');
    const [filterMedia, setFilterMedia] = useState('');
    const [filterReturned, setFilterReturned] = useState('');

    useEffect(() => {
        BorrowService.getAll()
            .then(response => setBorrowList(response.data))
            .catch(error => console.error(error));

        ClientService.getAll()
            .then(response => setClientList(response.data))
            .catch(error => console.error(error));

        MediaService.getAllMedias()
            .then(response => setMediaList(response.data))
            .catch(error => console.error(error));
    }, []);

    return (
        <div className="list-page">
            <div className="header-row">
                <h2>Borrow List</h2>
                <button className="modify-button">Add New Borrow</button>
            </div>

            {/* Filter Inputs */}
            <div className="filter-container">
                <div className="filter-box">
                    <label className="filter-label">Client</label>
                    <input
                        type="text"
                        value={filterClient}
                        onChange={(e) => setFilterClient(e.target.value)}
                        className="filter-input"
                        placeholder="Search by Client"
                    />
                </div>
                <div className="filter-box">
                    <label className="filter-label">Media</label>
                    <input
                        type="text"
                        value={filterMedia}
                        onChange={(e) => setFilterMedia(e.target.value)}
                        className="filter-input"
                        placeholder="Search by Media"
                    />
                </div>
                <div className="filter-box">
                    <label className="filter-label">Returned</label>
                    <input
                        type="text"
                        value={filterReturned}
                        onChange={(e) => setFilterReturned(e.target.value)}
                        className="filter-input"
                        placeholder="Search by Return Status"
                    />
                </div>
            </div>

            {/* Borrow List Display */}
            <div className="table">
                {borrowList.filter(borrow =>
                    clientList.find(client => client.clientId === borrow.clientId && client.name.toLowerCase().includes(filterClient.toLowerCase())) &&
                    mediaList.find(media => media.mediaId === borrow.mediaId && media.name.toLowerCase().includes(filterMedia.toLowerCase())) &&
                    (filterReturned ? borrow.returned.toString().includes(filterReturned.toLowerCase()) : true)
                ).map(borrow => {
                    const client = clientList.find(client => client.clientId === borrow.clientId);
                    const media = mediaList.find(media => media.mediaId === borrow.mediaId);
                    return (
                        <div className="table-row" key={borrow.borrowId}>
                            <div className="form-field">{client.name}</div>
                            <div className="form-field">{media.name}</div>
                            <div className="form-field">{borrow.borrowDate}</div>
                            <div className="form-field">{borrow.returnDate}</div>
                            <div className="form-field">{borrow.returned ? 'Returned' : 'Not Returned'}</div>
                            <div className="action-buttons">
                                <button className="modify-button">Modify</button>
                                <button className="delete-button">Delete</button>
                            </div>
                        </div>
                    );
                })}
            </div>
        </div>
    );
};

export default BorrowLister;
